import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as s,G as t,k as e}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":501624,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":501624,"name":"基尼奇","summary":"回火之狩 · 基尼奇","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/829ceb3bdc9e5c7f91d03c52c111a11c_4825365709203515402.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/aa6a18902984902d38b60eb79fb6c666_6192239197635175674.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/22e31321e1c0069c9105bcdbb8b4594f_3046788679527499765.png"},"attrs":[["地区","纳塔"],["星级","五星"],["神之眼所属","纳塔"],["元素","草"],["武器","双手剑"],["生日","11月11日"],["所属","维茨特兰"],["定位","草元素输出型角色"],["武器类型","双手剑"],["命之座","幻瑞兽座"],["称号","回火之狩"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/f922de239c7f2893c1abbc89108d02f2_3495234021419244675.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/f922de239c7f2893c1abbc89108d02f2_3495234021419244675.png\\" style=\\"width: 40px;\\"></span></span></span>七鹦之喙</p>","<p>通过悬猎·游骋高狩，基尼奇进行空中摆荡落地后，移动速度提升30%，持续6秒。</p><p>此外，迴猎贯鳞炮的暴击伤害提升100%。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/06b238b88e7431feba2d383c07ba440f_4876225903167951810.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/06b238b88e7431feba2d383c07ba440f_4876225903167951810.png\\" style=\\"width: 40px;\\"></span></span></span>星虎之掌</p>","<p>基尼奇的元素战技命中敌人时，将使其草元素抗性降低30%，持续6秒。</p><p>此外，基尼奇在进入夜魂加持状态下的首次迴猎贯鳞炮的影响范围提升，造成的伤害提升100%。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5d71906b4a26a7237ba90705d6fb5327_1718808206671702261.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5d71906b4a26a7237ba90705d6fb5327_1718808206671702261.png\\" style=\\"width: 40px;\\"></span></span></span>原鳄之爪</p>","<p>悬猎·游骋高狩的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5cd5969679ec0186a339eead0175c8be_6470013288526467869.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5cd5969679ec0186a339eead0175c8be_6470013288526467869.png\\" style=\\"width: 40px;\\"></span></span></span>蜂鸟之羽</p>","<p>处于夜魂加持状态下时，基尼奇进行环绕射击或施放迴猎贯鳞炮后，将为他恢复5点元素能量。每2.8秒至多通过这种方式恢复一次元素能量。</p><p>此外，向伟大圣龙致意造成的伤害提升70%。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/eacb9a758f1fc86a38a308be6a6713ca_8644284701797065608.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/eacb9a758f1fc86a38a308be6a6713ca_8644284701797065608.png\\" style=\\"width: 40px;\\"></span></span></span>吼猴之尾</p>","<p>向伟大圣龙致意的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5ca9534655dc4556fab34e110df9d5df_3441172518411718773.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5ca9534655dc4556fab34e110df9d5df_3441172518411718773.png\\" style=\\"width: 40px;\\"></span></span></span>瑞兽之形</p>","<p>迴猎贯鳞炮在命中敌人后，将在敌人间弹跳一次，造成基尼奇的攻击力700%的草元素伤害。</p><p>如果本次迴猎贯鳞炮触发了固有天赋「焰灵的契约」或命之座「星虎之掌」对迴猎贯鳞炮的增强效果，它所引发的弹跳攻击也会获得上述效果的增强。</p>"]],"skill":[{"title":"普通攻击·夜阳斗技","desc":"普通攻击\\n进行至多三段的连续攻击。\\n通过元素战技「悬猎·游骋高狩」进行空中摆荡后，在落地之前能在空中进行一次普通攻击。\\n\\n重击\\n消耗一定体力，向前方旋转地投出大剑攻击敌人。\\n\\n下落攻击\\n从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成范围伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/bf476ee331bb00594f0c600358e00272_6518366944104907173.png"},{"title":"悬猎·游骋高狩","desc":"以狩猎巨兽的心得，快速移动或对敌人发起攻击。\\n若身边存在敌人或能被攻击的物件，会将钩索链接在目标上，以0点夜魂值进入夜魂加持状态；\\n否则，会向前方发射钩索进行空中摆荡，并使冷却时间缩短60%；\\n能够长按施放。\\n长按时，能够瞄准以决定发射钩索的方向。\\n\\n夜魂加持·基尼奇\\n基尼奇的夜魂加持状态持续10秒，每秒将产生2点夜魂值。\\n在夜魂加持状态下，基尼奇会以钩索链接身边的敌人，并据此改变攻击方式：\\n·进行普通攻击时依据当前移动的方向，以链接的目标为中心，进行环绕射击，造成具有夜魂性质的草元素伤害，并产生3点夜魂值。\\n环绕射击造成的伤害视为元素战技伤害；\\n·夜魂值达到上限时，能够施放元素战技「迴猎贯鳞炮」：消耗所有夜魂值，造成具有夜魂性质的草元素伤害。\\n长按施放迴猎贯鳞炮时，能够瞄准以决定攻击的目标。施放迴猎贯鳞炮后，基尼奇将会尝试链接迴猎贯鳞炮的目标。\\n在夜魂加持状态下，链接敌人或施放迴猎贯鳞炮后，将会在敌人身边产生死角区，基尼奇进入死角区会产生4点夜魂值，并移除死角区。\\n链接因超出距离等原因断开时，进行普通攻击会与身边的敌人重新建立链接并进行环绕射击。\\n\\n「凡事皆有代价，希望你能给出合适的价码…什么？我可不接受分期付款。」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/a0fb4543c4e6acd25d0536414cbd9906_3324190478526517572.png"},{"title":"向伟大圣龙致意","desc":"（有限度、有条件、有节制地，依照契约，部分、暂时）解放「圣龙阿乔」的力量，造成具有夜魂性质的草元素范围伤害。\\n圣龙阿乔将在持续期间周期性释放龙息，造成具有夜魂性质的草元素范围伤害。\\n施放时，若基尼奇处于夜魂加持状态下，此次夜魂加持的持续时间延长1.7秒。\\n\\n「没错！站在汝等面前的便是伟大圣龙库胡勒阿乔，还不快快上前亲吻吾的脚背！」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/c7da03dfb66ea9e07f96e2b460191aba_3593422970930898445.png"},{"title":"噩地的代价","desc":"\\n处于夜魂加持状态下时，基尼奇的元素战技命中的敌人，将陷入「噩地」状态，在受到燃烧反应或烈绽放反应伤害时，为基尼奇产生7点夜魂值，每0.8秒至多通过这种方式产生一次夜魂值。\\n噩地状态持续直至基尼奇此次夜魂加持状态结束。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/5a74db1a8e2b6c2fafeca805cbfd146e_3010514103188535971.png"},{"title":"焰灵的契约","desc":"队伍中的附近的角色触发「夜魂迸发」后，将为基尼奇赋予一层「猎人心得」，持续15秒，至多叠加2层。\\n基尼奇在施放悬猎·游骋高狩的迴猎贯鳞炮时，将消耗所有的「猎人心得」，并依据消耗的层数，每层使本次迴猎贯鳞炮造成的伤害基于基尼奇攻击力的320%提高。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/b29be5981e58c58387ebe25ab1aa2eca_8336534914193633452.png"},{"title":"夜域赐礼·索报皆偿","desc":"通过悬猎·游骋高狩，基尼奇进行空中摆荡后处于空中时，能够消耗10点燃素以再次进行空中摆荡。\\n在纳塔存在燃素机制的区域时，能够进行夜魂传递·基尼奇。当前场上角色处于冲刺状态、特定天赋赋予的移动状态下，或是位于空中时，切换基尼奇登场时，基尼奇将依照条件，进行以下行动之一：\\n·朝向可以交互的卷叶符印时：向它发射钩索以进行移动；\\n·身边有敌人并处于战斗状态时：向该敌人施放悬猎·游骋高狩；\\n否则，发射钩索，进行空中摆荡。基尼奇将优先以符合条件的卷叶符印为发射钩索的目标。\\n自己的队伍每10秒能触发一次夜魂传递。\\n\\n在与卷叶符印等能够与匿叶龙交互的物件互动时，悬猎·游骋高狩将被替换为「匿叶仿生」，通过匿叶仿生与这些物件交互时，这些物件的交互规则沿袭匿叶龙的交互规则，并且不会使悬猎·游骋高狩进入冷却。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/a6855f1c24ad06e0ffc08b4bad28343c_2770887855622456900.png"},{"title":"疾行的使令","desc":"在纳塔存在燃素机制的区域时，与部分采集物交互能够使队伍中自己的角色移动速度提高15%,持续10秒。\\n此外，在小地图上显示周围的纳塔区域特产的位置。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/09/08/4328207/d1a5db3a35c6d388d27fb7febf1444a1_3918161704716722300.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/501624.md","filePath":"game/ys/role/[pkg].md"}'),i={name:"game/ys/role/501624.md"},g=Object.assign(i,{setup(c){return(o,d)=>(s(),p("div",null,[t(e(a))]))}});export{r as __pageData,g as default};
